import "./App.css";
import Select from "react-select";
import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [data, setDatas] = useState([]);
  useEffect(() => {
    const getBerries = async () => {
      try {
        const callBerries = await axios.get("https://pokeapi.co/api/v2/berry/");
        const value = await callBerries.json()
        const result = value.results.map(data => {
          return {
            value: data.name,
            label: data.name
          }
        })
        setDatas(result);
        console.log(callBerries);
      } catch (err) {
        console.log(err);
      }
    };
    getBerries();
  }, []);

  return (
    <div className="App">
      <Select options={data} />
    </div>
  );
}

export default App;
